function preventDefault(e) {
    e = e || window.event;
    if (e.preventDefault) e.preventDefault();
    e.returnValue = false;
}

function preventDefaultForScrollKeys(e) {
    if (keys[e.keyCode]) {
        preventDefault(e);
        return false;
    }
}

var configOwl = function () {
    $(".owl-carousel").each(function () {
        var padding = $(this).data("padding");
        var paddingTab = $(this).data("padding-tab");
        var paddingMobile = $(this).data("padding-mobile");
        var nav = !!$(this).data("nav");
        var dots = !!$(this).data("dots");
        var autoWidth = !!$(this).data("dekstop-autowidth");
        var autoWidthMobile = !!$(this).data("mobile-autowidth");
        var center;
        var countDekstop = $(this).data("show-dekstop");
        var countTab = $(this).data("show-tab");
        var countMobile = $(this).data("show-mobile");
        var stagePadding = $(this).data("stage-padding");
        var loop = !!$(this).data("loop");

        if ($(window).width() > 991) {
            //autoWidth = $(this).data('dekstop-autowidth') ? true : false;
            center = !!$(this).data("dekstop-center");
        } else {
            //autoWidth = $(this).data('mobile-autowidth') ? true : false;
            center = !!$(this).data("mobile-center");
        }

        var $owlOption = {
            loop: loop,
            margin: padding,
            nav: nav,
            dots: dots,
            autoWidth: autoWidth,
            navText: "",
            center: center,
            lazyLoad: false,
            responsive: {
                0: {
                    margin: paddingMobile,
                    autoWidth: autoWidthMobile,
                    items: countMobile ? countMobile : 1,
                },
                600: {
                    margin: paddingMobile,
                    autoWidth: autoWidthMobile,
                    items: countTab ? countTab : 1,
                },
                769: {
                    margin: paddingTab,
                    items: countDekstop ? countDekstop : 3,
                },
                1025: {
                    margin: padding,
                    items: countDekstop ? countDekstop : 3,
                },
            },
        };
        if (stagePadding) $owlOption.stagePadding = stagePadding;
        var elem = $(this); // Notice that initialize.owl.carousel and initialized.owl.carousel events must be attached before Owl Carousel initialization.

        elem.on("initialized.owl.carousel", function (event) {
            var widthInit = $(".js-auto-square .item img").css("width");

            if (widthInit) {
                $(".js-auto-square .item .item-wall-feed").css("height", widthInit);
                $(".js-auto-square .item .instagram-post").css("height", widthInit);
            }

            var partnerWidthInit = $(".js-auto-square-partner .item").css("width");

            if (partnerWidthInit) {
                $(".js-auto-square-partner .item figure").css("height", partnerWidthInit);
            }
        });
        var windowWidth = $(window).width();

        if (windowWidth < 992) {
            elem.on("drag.owl.carousel", function (event) {
                if (window.addEventListener)
                    // older FF
                    window.addEventListener("DOMMouseScroll", preventDefault, false);
                window.onwheel = preventDefault; // modern standard

                window.onmousewheel = document.onmousewheel = preventDefault; // older browsers, IE

                window.ontouchmove = preventDefault; // mobile

                document.onkeydown = preventDefaultForScrollKeys;
                $("body").addClass("disableDrag");
            });
            elem.on("dragged.owl.carousel", function (event) {
                if (window.removeEventListener) window.removeEventListener("DOMMouseScroll", preventDefault, false);
                window.onmousewheel = document.onmousewheel = null;
                window.onwheel = null;
                window.ontouchmove = null;
                document.onkeydown = null;
                $("body").removeClass("disableDrag");
            });
        }

        elem.on("changed.owl.carousel", function (event) {
            var page = event ? event.page : "";
            var item = event ? event.item : "";
            var targetId = event && event.target ? event.target.id : "";

            if (!page || !item || !targetId) {
                return;
            }

            if (item.index <= 0) {
                $('.js-prev-carousel[data-target="' + targetId + '"]').hide();
            } else {
                $('.js-prev-carousel[data-target="' + targetId + '"]').show();
            }

            if (item.index >= item.count - page.size) {
                $('.js-next-carousel[data-target="' + targetId + '"]').hide();
            } else {
                $('.js-next-carousel[data-target="' + targetId + '"]').show();
            }
        });
        elem.on("refresh.owl.carousel", function () {
            var _this = $(this);

            setTimeout(function () {
                // Recalculate olw-dots
                var dotsCounts = _this.find(".owl-dot").length;

                var dotsContainerWidth = _this.find(".owl-dots").outerWidth();

                _this.find(".owl-dot").css("width", dotsContainerWidth / dotsCounts);

                if (dotsCounts <= 1) {
                    _this.find(".owl-dots").addClass("disabled");
                }
            }, 8);
        });
        elem.owlCarousel($owlOption);

        if (center) {
            elem.trigger("next.owl.carousel");
        }
    });
    $(".js-prev-carousel").on("click", function (e) {
        e.preventDefault();
        var target = $(this).data("target");
        $("#" + target).trigger("prev.owl.carousel");
    });
    $(".js-next-carousel").on("click", function (e) {
        e.preventDefault();
        var target = $(this).data("target");
        $("#" + target).trigger("next.owl.carousel");
    });
};
