function msieversion() {
    var ua = window.navigator.userAgent;
    var msie = ua.indexOf("MSIE ");

    if (msie > 0 || !!navigator.userAgent.match(/Trident.*rv\:11\./)) {
        return parseInt(ua.substring(msie + 5, ua.indexOf(".", msie)));
    }

    return false;
} // Fixed pagination : DEPRECATED!

function paginationFixed() {
    var $paginationFixed = $(".js-article-pagination-fixed");

    if ($paginationFixed.length > 0) {
        var $setPadding = $paginationFixed.innerHeight();
        $(".footer").css("padding-bottom", $setPadding);
        $(window).scroll(function (e) {
            var scrollTop = $(this).scrollTop();
            clearTimeout($.data(this, "scrollTimer"));
            $paginationFixed.hide();

            if (scrollTop <= 0) {
                $paginationFixed.hide();
            } else {
                $.data(
                    this,
                    "scrollTimer",
                    setTimeout(function () {
                        if (scrollTop == 0) {
                            $paginationFixed.hide();
                        } else {
                            $paginationFixed.slideDown();
                        }
                    }, 250)
                );
            }
        });
    }
} // End Fixed pagination : DEPRECATED!

function debounce(func, wait, immediate) {
    var timeout;
    return function () {
        var context = this,
            args = arguments;

        var later = function () {
            timeout = null;
            if (!immediate) func.apply(context, args);
        };

        var callNow = immediate && !timeout;
        clearTimeout(timeout);
        timeout = setTimeout(later, wait);
        if (callNow) func.apply(context, args);
    };
}

