_MG.Modules.Ad.init = function initAds() {
    // var leaderboard_dim = [[728, 90], [970, 90], [320, 50]];
    // var rectangle_dim = [300, 250];

    var leaderboard_728_dim = [728, 90];
    var leaderboard_970_dim = [970, 90];
    var leaderboard_320_dim = [320, 50];
    var rectangular_300_dim = [300, 250];
    var rectangular_250_dim = [250, 250];
    var rectangular_300L_dim = [300, 600];
    var rectangular_wallpaper_dim = [1, 1];
    var mobile_banner_lg_dim = [320, 100];
    var miniscroller_dim = ["fluid"];

    var leaderboard_ads = document.getElementsByClassName("js-leaderboard-ads");
    var leaderboard_ad_ids = [];
    for (var i = 0; i < leaderboard_ads.length; i++) {
        leaderboard_ad_ids.push(leaderboard_ads[i].id);
    }

    var medium_ads = document.getElementsByClassName("js-medium-ads");
    var medium_ad_ids = [];
    for (var i = 0; i < medium_ads.length; i++) {
        medium_ad_ids.push(medium_ads[i].id);
    }

    var leaderboards_320_ads = document.getElementsByClassName("js-leaderboard-320-ads");
    if (leaderboards_320_ads.length > 0) setGptAds(leaderboards_320_ads, leaderboard_320_dim);

    var leaderboards_728_ads = document.getElementsByClassName("js-leaderboard-728-ads");
    if (leaderboards_728_ads.length > 0) setGptAds(leaderboards_728_ads, leaderboard_728_dim);

    var leaderboards_970_ads = document.getElementsByClassName("js-leaderboard-970-ads");
    if (leaderboards_970_ads.length > 0) setGptAds(leaderboards_970_ads, leaderboard_970_dim);

    var rectangular_300_ads = document.getElementsByClassName("js-rectangular-300-ads");
    if (rectangular_300_ads.length > 0) setGptAds(rectangular_300_ads, rectangular_300_dim);

    var rectangular_300L_ads = document.getElementsByClassName("js-rectangular-300L-ads");
    if (rectangular_300L_ads.length > 0) setGptAds(rectangular_300L_ads, rectangular_300L_dim);

    var rectangular_250_ads = document.getElementsByClassName("js-rectangular-250-ads");
    if (rectangular_250_ads.length > 0) setGptAds(rectangular_250_ads, rectangular_250_dim);

    var rectangular_wallpaper_ads = document.getElementsByClassName("js-rectangular-wallpaper-ads");
    if (rectangular_wallpaper_ads.length > 0) setGptAds(rectangular_wallpaper_ads, rectangular_wallpaper_dim);

    var mobile_banner_lg_ads = document.getElementsByClassName("js-mobile-banner-lg-ads");
    if (mobile_banner_lg_ads.length > 0) setGptAds(mobile_banner_lg_ads, mobile_banner_lg_dim);

    var miniscroller_ads = document.getElementsByClassName("js-miniscroller-ads");
    if (miniscroller_ads.length > 0) setGptAds(miniscroller_ads, miniscroller_dim);
};

var setGptAds = function (adSlot, dimension) {
    for (var i = 0; i < adSlot.length; i++) {
        var slot_id = adSlot[i].id;
        var ad_slot = document.getElementById(slot_id);
        if (ad_slot) {
            var gpt_data = ad_slot.getAttribute("data-gpt");
            googletag.defineSlot(gpt_data, dimension, slot_id).addService(googletag.pubads());
            googletag.display(slot_id);
        }
    }
};

if (window.DIDOMI_ENABLED) {
    window.didomiOnReady = window.didomiOnReady || [];
    window.didomiOnReady.push(function (Didomi) {
        // The SDK is done loading, check the consent status of the user
        var consentStatus = Didomi.getUserConsentStatusForVendor("google");
        if (consentStatus === true) {
            // The user has given consent for that vendor, fire the custom events
            if (typeof googletag !== "undefined") {
                googletag.cmd.push(_MG.Modules.Ad.init);
            }
        } else if (consentStatus === undefined) {
            // The consent status of the user is not known yet
            // Subscribe to the consent.changed event to get notified when it does
            Didomi.on("consent.changed", function () {
                // The consent status of the user has changed
                var consentNewStatus = Didomi.getUserConsentStatusForVendor("google");
                if (consentNewStatus === true) {
                    if (typeof googletag !== "undefined") {
                        googletag.cmd.push(_MG.Modules.Ad.init);
                    }
                }
            });
        }
    });
} else if (typeof googletag !== "undefined") {
    googletag.cmd.push(_MG.Modules.Ad.init);
}

